import './App.css';

function App() {
  return (
    <div className="App">
      <div className="first-content">
        <p>Azamat Alishev</p>
      </div>
      <div className="content">
        <p>Based in the US. Currently at Stash working as a Devops Engineer.</p>
        <p>I specialize in infrastructure, pipelines and monitoring.</p>
      </div>
      <div className="content">
      <h2 class="header">Selected clients</h2>
        <p>I specialise in helping products grow based on user metrics.</p>
      </div>
    </div>
  );
}

export default App;
